import React from "react";

const WorkBanner = (props) => {
    return(
        <div className="row justify-content-center">
            <div className="col-md-3">
                Web Dev
            </div>
            <div className="col-md-3">
                Twitch
            </div>
            <div className="col-md-3">
                Audio
            </div>
        </div>
    )
}

export default WorkBanner;
